package com.kalos.datos.adaptadores;import java.util.List;import com.kalos.beans.InterjeccionBean;import com.kalos.bibliotecadatos.FuenteDatosCacheable;import com.kalos.datos.gerentes.GerenteInterjecciones;import org.apache.log4j.Logger;public class AdaptadorGerenteInterjecciones implements FuenteDatosCacheable {    private List<String> U;    private GerenteInterjecciones gerenteInterjecciones;    Logger T = Logger.getLogger(getClass().getName());    public AdaptadorGerenteInterjecciones (GerenteInterjecciones paramjA) {	this.gerenteInterjecciones = paramjA;    }    public void seleccionaPorLetraInicial(String paramString) {	this.U = this.gerenteInterjecciones.seleccionaPorLetra(paramString);    }    public void seleccionaPorCanonica(String paramString) {	this.U = this.gerenteInterjecciones.seleccionaPorCanonica(paramString);    }    public List<?> getBeans(List<String> paramList) {	List<InterjeccionBean> localList = this.gerenteInterjecciones.getBeans(paramList);	return localList;    }    public int getLongitudTotal() {	return this.U.size();    }    public List<String> getTodosLosId() {	return this.U;    }}